    link:"",
    used:"C++ Libraries"
  },
  {name:"API Development in C++",
  image:"https://assets-global.website-files.com/6228e4b0518bd64c391affa4/622902d6c427f74b6db921e1_catalog-lyft.gif",
  link:"",
  used:"C++ Libraries"
},
{name:"API Development in C++",
image:"https://assets-global.website-files.com/6228e4b0518bd64c391affa4/622902d6c427f74b6db921e1_catalog-lyft.gif",
link:"",
used:"C++ Libraries"
},
{name:"API Development in C++",
image:"https://assets-global.website-files.com/6228e4b0518bd64c391affa4/622902d6c427f74b6db921e1_catalog-lyft.gif",
link:"",
used:"C++ Libraries"
},
];
export default function projectslist() {
  return (
    <div className='flex justify-center'>
    <div className='grid grid-cols-2 gap-40'>
      {projects.map((ele)=>{
        return(
          <div className='border border-8 border-[#fef0cc] bg-black hover:bg-[#2a66ad] w-[30vw] '>
          <img className="p2"src={ele.image} alt=""/>
          <h1 className='mt-2 text-[#fef0cc] font-semibold text-3xl'>{ele.name}</h1>
          <p>{ele.used}</p>
          
          </div>
        )
      })
      }
    </div>
    </div>
  )
}
